import React, { Fragment } from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { logout } from "../../actions/auth";
import Logo from "../../images/logo.png";
import Button from 'react-bootstrap/Button';
// import Modal from 'react-bootstrap/Modal';
// import Metamask from '../../images/meta_mask.png'
// import Form from 'react-bootstrap/Form';



const Navbar = ({ auth: { isAuthenticated, loading }, logout }) => {
	// const [state, setstate] = useState();

	// Setstate For Modal
	// const [show, setShow] = useState(false);
	// const handleClose = () => setShow(false);
	// const handleShow = () => setShow(true);


	const authLinks = (
		<ul className="nav-links mt-5 list-unstyled">
			<li>
				<Link to="/dashboard">
					<i className="fas fa-user"></i>{" "}
					<span className="hide-sm">Dashboard</span>
				</Link>
			</li>
			<li>
				<Link onClick={logout} to="/" replace>
					<i className="fa fa-arrow-right"></i>{" "}
					<span className="hide-sm">Logout</span>
				</Link>
			</li>
		</ul>

	);
	const guestLinks = (
		<>
			<div className="d-flex justify-content-end">
				<input type="search" className="search-items" placeholder="Search Items Here...." /> &nbsp;&nbsp;
				<div className="dropdown">
					<Button className="m-0 text-dark" type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false" style={{ background: "#d8ff00", color: "black" }}><i className="fa fa-bars"></i></Button> &nbsp;
					<div class="dropdown-menu p-3 shadow-lg" aria-labelledby="dropdownMenuButton">
						<a class="dropdown-item" href="/">Home</a>
						<a class="dropdown-item" href="/aboutus">About Us</a>
						<a class="dropdown-item" href="/contactus">Contact Us</a>
						<a class="dropdown-item" href="/tnc">Admin Policy</a>
						<a class="dropdown-item" href="/privacy">Privacy Policy</a>
						<a class="dropdown-item" href="/adminPolicy">Terms & Conditions</a>
						<a class="dropdown-item" href="/faqs">FAQs</a>
					</div>
				</div>
				<Button href="/" className="m-0 text-dark" style={{ background: "#d8ff00", color: "black" }}><i className="fa fa-user"></i></Button> &nbsp;&nbsp;
				<Button href="/" className="m-0 text-dark" style={{ background: "#d8ff00", color: "black" }}><i className="fa fa-wallet"></i></Button> &nbsp;&nbsp;
				<Button href="/" className="m-0 text-dark" style={{ background: "#d8ff00", color: "black" }}><i className="fa fa-shopping-cart"></i></Button> &nbsp;&nbsp;


				{/* <Button variant="outline-info jwu" onClick={handleShow} className="m-0">
					Join Us
				</Button>

				<Modal show={show} onHide={handleClose}>
					<Modal.Header closeButton>
						<Modal.Title className="text-info font-weight-bold">Connect Wallet</Modal.Title>
					</Modal.Header>
					<Modal.Body>

						<Button variant="outline-warning jwu w-100" onClick={handleShow}>
							<img src={Metamask} className="d-inline" height={"30px"} alt="NFT" /> &nbsp;
							Sign In With Metamask
						</Button>

					</Modal.Body>

				</Modal> */}
			</div>
		</>
	);

	return (
		<nav className="navbar bg-dark">
			<h1 align="center">
				<a href="/" ><img src={Logo} alt="NFT" /></a>
			</h1>
			{!loading && (
				<Fragment>{isAuthenticated ? authLinks : guestLinks}</Fragment>
			)}
		</nav>
	);
};

Navbar.propTypes = {
	logout: PropTypes.func.isRequired,
	auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
	auth: state.auth,
});

export default connect(mapStateToProps, { logout })(Navbar);
